import type { Config } from "release-it";

export default {
	git: {
		commitMessage: "v${version}",
		tagName: "v${version}",
	},
	npm: {
		publish: false,
	},
	hooks: {
		"after:bump": "tsx scripts/release.ts",
	},
} satisfies Config;

[workspace]
resolver="2"
members = [
    "src-tauri"
]

[workspace.dependencies]
tauri = "2" 
serde = "1"
serde_json = "1"
fs_extra = "1.3.0"
log = "0.4.22"
cocoa = "0.25.0"
tauri-plugin-shell = "2"
tauri-plugin-fs-pro = "2"
tauri-plugin = { version = "2", features = ["build"] }
tauri-nspanel = { git = "https://github.com/ahkohd/tauri-nspanel", branch = "v2" }
tauri-plugin-eco-window = { path = "./src-tauri/src/plugins/window" }
tauri-plugin-eco-locale = { path = "./src-tauri/src/plugins/locale" }
tauri-plugin-eco-clipboard = { path = "./src-tauri/src/plugins/clipboard" }
tauri-plugin-eco-ocr = { path = "./src-tauri/src/plugins/ocr" }
tauri-plugin-eco-paste = { path = "./src-tauri/src/plugins/paste" }
tauri-plugin-eco-autostart = { path = "./src-tauri/src/plugins/autostart" }

import presetRemToPx from "@unocss/preset-rem-to-px";
import {
	defineConfig,
	presetIcons,
	presetUno,
	transformerDirectives,
	transformerVariantGroup,
} from "unocss";

export default defineConfig({
	presets: [
		presetUno(),
		presetIcons(),
		presetRemToPx({
			baseFontSize: 4,
		}),
	],
	transformers: [
		transformerVariantGroup(),
		transformerDirectives({
			applyVariable: ["--uno"],
		}),
	],
	rules: [["outline-none", { outline: "none" }]],
	shortcuts: [
		[/^bg-color-(\d+)$/, ([, d]) => `bg-bg-${d}`],
		[/^text-color-(\d+)$/, ([, d]) => `text-text-${d}`],
		[/^b-color-(\d+)$/, ([, d]) => `b-border-${d}`],
		[/^(.*)-primary-(\d+)$/, ([, s, d]) => `${s}-[var(--ant-blue-${d})]`],
		{
			"antd-input":
				"b hover:b-primary-5 transition outline-none focus:antd-input-focus",
			"antd-input-focus":
				"b-primary shadow-[0_0_0_2px_rgba(5,145,255,0.1)] dark:shadow-[0_0_0_2px_rgba(0,60,180,0.15)]",
		},
	],
	theme: {
		colors: {
			"bg-1": "var(--ant-color-bg-container)",
			"bg-2": "var(--ant-color-bg-layout)",
			"bg-3": "var(--ant-color-fill-quaternary)",
			"bg-4": "var(--ant-color-fill-content)",
			"text-1": "var(--ant-color-text)",
			"text-2": "var(--ant-color-text-secondary)",
			"text-3": "var(--ant-color-text-tertiary)",
			"border-1": "var(--ant-color-border)",
			"border-2": "var(--ant-color-border-secondary)",
			primary: "var(--ant-blue)",
			success: "var(--ant-green)",
			danger: "var(--ant-red)",
			gold: "var(--ant-gold)",
			qq: "#0099ff",
			wechat: "#00c25f",
			alipay: "#0c79fe",
		},
	},
});

import react from "@vitejs/plugin-react";
import UnoCSS from "unocss/vite";
import AutoImport from "unplugin-auto-import/vite";
import { defineConfig } from "vite";

const host = process.env.TAURI_DEV_HOST;

// https://vitejs.dev/config/
export default defineConfig(async () => ({
	plugins: [
		react(),
		UnoCSS(),
		AutoImport({
			imports: ["react", "ahooks", "react-router-dom", "react-i18next"],
			dts: "src/types/auto-imports.d.ts",
			dirs: [
				"src/router",
				"src/utils",
				"src/stores",
				"src/database",
				"src/hooks",
				"src/constants",
				"src/plugins",
				"src/locales",
			],
		}),
	],
	resolve: {
		alias: {
			"@": "/src",
		},
	},
	// Vite options tailored for Tauri development and only applied in `tauri dev` or `tauri build`
	//
	// 1. prevent vite from obscuring rust errors
	clearScreen: false,
	// 2. tauri expects a fixed port, fail if that port is not available
	server: {
		port: 1420,
		strictPort: true,
		host: host || false,
		hmr: host
			? {
					protocol: "ws",
					host,
					port: 1421,
				}
			: undefined,
		watch: {
			// 3. tell vite to ignore watching `src-tauri`
			ignored: ["**/src-tauri/**"],
		},
	},
	build: {
		chunkSizeWarningLimit: 3000,
	},
	css: {
		preprocessorOptions: {
			scss: {
				// https://sass-lang.com/documentation/breaking-changes/legacy-js-api/#silencing-warnings
				silenceDeprecations: ["legacy-js-api"],
			},
		},
	},
}));
